import Card from "./Card";

const AddExpenseButton = (props) => {
  const clickHandeler = () => {
    props.onBtnClick(false);
  };
  return (
    <Card className={"add-new-expense-container"}>
      <button onClick={clickHandeler} className="new-expense-btn">
        Add New Expense
      </button>
    </Card>
  );
};
export default AddExpenseButton;
